import React from 'react';
import { Link } from "react-router-dom";
import { NavLink } from 'react-router-dom';
import styles from './NavBar.module.scss';
import SampleChoiceWrapper from './SampleChoiceWrapper';

const links = [
  { pathname: '/training', text: 'Training', icon: <SampleChoiceWrapper /> },
  { pathname: '/training', text: 'Training1', icon: <SampleChoiceWrapper /> },
];

const Navbar: React.FC = () => {
  return (
    <div className="w-full bg-indigo-500 py-2">
      <div className="flex flex-row">
        <></>
        {links.map((link) => (
          <NavLink to={link.pathname} className="flex flex-col">{link.text}</NavLink>
        ))}
      </div>
    </div>
  );
};

export default Navbar;
